import React from "react";
import ReactDOM from "react-dom";
import { Routes, Route } from "react-router-dom";
import App from "./App";
import SearchBooks from "./SearchBooks";

import "./index.css";

// const Routes = () => (
//   <Routes>
//     <Route exact path="/">
//       <App />
//     </Route>
//     <Route path="/search">
//       <SearchBooks />
//     </Route>
//   </Routes>
// );

ReactDOM.render(
  <Routes>
    <Route exact path="/">
      <App />
    </Route>
    <Route path="/search">
      <SearchBooks />
    </Route>
  </Routes>,
  document.getElementById("root")
);
